import React from 'react';
import logo from './../logo.svg';
import './Header.css';

class Header extends React.Component {
  changeModeToEdit = () => this.props.changeModeToEdit(this.props.modes.appMode);
  changeModeToNonEdit = () => this.props.changeModeToNonEdit(this.props.modes);
  render() {
    return (
      <header>
        <img className="heroLogo" alt="CV Builder Logo" src={logo} />
        <h1>CV Builder</h1>
        <button onClick={this.changeModeToEdit}>EDIT MODE</button>
        <button onClick={this.changeModeToNonEdit}>VIEW MODE</button>
      </header>
    );
  }
}

export default Header;
